import React from 'react';

const AboutSection = () => {
  return (
    <section className="bg-gray-100 py-16 px-4">
      <div className="container mx-auto text-center">
        <h2 className="text-3xl font-bold text-gray-800 mb-8">Nuestra Historia</h2>
        <p className="text-lg text-gray-700 max-w-3xl mx-auto">
          Somos apasionados por la naturaleza y el cuidado personal. Creamos jabones artesanales con ingredientes orgánicos y sostenibles, hechos a mano con técnicas tradicionales para ofrecerte una experiencia única y saludable para tu piel. Creemos en la belleza simple y en el poder de lo natural.
        </p>
      </div>
    </section>
  );
};

export default AboutSection;
